import { data } from '../../data/data';

export default function Galerie() {

    let listThematiques = data.thematique;

    return (
        <>
            <div>
                Galerie
                <div id='listThematiques'>
                        {listThematiques.map(animateur => <div className='animateurInfos' id= {'animateur_'+animateur.nom} onClick={() => choixAnimateur({animateur})} >{animateur.nom}</div>)}
                </div>
            </div>
        </>
    )
}
